    false,nt"url": null,nt"notes": "NCEI Accession 0127322 contains raw underway
    meteorological, navigational, physical and time series data logged by the Scientific
    Computer System (SCS) aboard NOAA Ship Hi'ialakai in the North Pacific Ocean and
    South Pacific Ocean from 2015-01-22 to 2015-05-04. Office of Marine and Aviation
    Operations (OMAO) personnel aboard the ship submitted these data and associated
    metadata to NCEI. In addition, NCEI Accession 0127322 contains supplementary cruise-level
    metadata, which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO
    and NCEI personnel developed the automated process to archive these data under the
    auspices of the NOAA Rolling Deck to Repository (NOAA R2R) program.",nt"owner_org":
